Description:
I offer the following services :

    Administration, configuration and protection of servers (Dedicated / VPS) baseon CentOS, Debian, Ubuntu, FreeBSD, etc;
    Installation, configuration and optimization of various services (Apache, nginx MySQL, Postfix, Exim, Dovecot, etc);
    Install and configure SSL according to the latest security requirements;
    Configuring virtualization systems, VPN tunnels, monitoring systems;
    Setting up IP telephony systems - asterisk, freeswitch and others;
    Migration of projects and data between servers / vps / vds / hosting;
    Monthly maintenance;
    Consulting services.
